function Cart(props) {
	console.log(props);
	const card = props.map((item, pos) => {
		return(
			<div>
				<h2>{item.name}</h2>
				<img src={item.img}/>
				<p>{item.phone}</p>
				<p>{item.email}</p>
			</div>
		)
	})
}

export default Cart;
